import React from "react";
import { useNavigate } from 'react-router-dom';

const Header = () => {

    const navigate = useNavigate();

    const handleLogin = () => navigate(`/playlist`);

  return (
    <header style={{ 
        display: "flex",
        justifyContent: "space-between",
        alignItems: "center",
        padding: "20px",
        backgroundColor: "#f0f0f0"
        }}>
        <div style={{ 
            color: "#333",
            fontFamily: "Arial, sans-serif",
            fontSize: "24px",
            fontWeight: "bold"
            }}>
            <h1>Welcome to My Website</h1>
            <p>Learn more about what we have to offer</p>
        </div>
        <div>
            <form style={{ 
                display: "flex",
                alignItems: "center",
                gap: "10px"
            }}>
            <label htmlFor="email" style={{ 
                color: "#333",
                fontFamily: "Arial, sans-serif",
                fontSize: "16px",
                fontWeight: "bold"
            }}>Email:</label>
            <input 
                type="email" 
                id="email" 
                name="email" 
                required 
                style={{ 
                    padding: "10px",
                    border: "none",
                    borderRadius: "5px"
                }}
            />
            <label htmlFor="password" style={{ 
                color: "#333",
                fontFamily: "Arial, sans-serif",
                fontSize: "16px",
                fontWeight: "bold"
            }}>Password:</label>
            <input 
                type="password" 
                id="password" 
                name="password" 
                required 
                style={{ 
                    padding: "10px",
                    border: "none",
                    borderRadius: "5px"
                }}
            />
            <button 
                type="submit"
                style={{ 
                    padding: "10px 20px",
                    backgroundColor: "#1DB954",
                    color: "#fff",
                    border: "none",
                    borderRadius: "5px",
                    fontFamily: "Arial, sans-serif",
                    fontSize: "16px",
                    fontWeight: "bold",
                    cursor: "pointer"
                }}
                onClick={() => handleLogin()}
            >
                Log in
            </button>
            </form>
        </div>
    </header>
  );
};

export default Header;
